import './components.css';
import { navBar as NavBar } from './header';
import { Col } from 'react-bootstrap';

export default function Story(props) {
  return (
    <div>
      <NavBar />
      <Col lg={4} md={6} sm={12} className="page">
        <h1>Heading</h1>
	<div>Description</div>
	<div className="page-details">
	  <Col className="page-author">Author</Col>
	  <Col className="page-date">Date posted</Col>
	  <div className="page-stats">
	    <div>
	      <div className="page-likes"></div>
	      <span>0</span>
	    </div>
	    <div>
	      <div className="page-comments"></div>
	      <div>0</div>
	    </div>
	  </div>
	</div>
      </Col>
    </div>
  );
}
